import classes from './AddUserorGroup.module.css';

const AddUserorGroup=()=>{


return (

  <>	

   <div className={classes.newusergroupbar}>

     <button type="button" className={classes.addContact}>+New Chat  </button>

     <button type="button" className={classes.createGroup}>+New Group Chat  </button>

   </div>

   <div className={classes.explainButton}>  Select contacts for new chat</div>

</>

);


}

export default AddUserorGroup;
